【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ Basic Plate：ワッフル、スクエアホットサンド、パニーニの3種類のプレートを付属。<br />・ワッフルプレート<br />「外はサクッ、中はふわっ」の本格的なベルギーワッフルの焼き上がりを追求した、こだわりの深型プレート。<br />フルーツやクリームでデコレーションを楽しんだり、甘くない生地で朝食やブランチメニューにも。<br /><br />・スクエアホットサンドプレート<br />新登場の仕切りのないホットサンドプレート。<br />たっぷり具を挟めるから、味も見た目もボリュームのある仕上がりに。<br />ハムやベーコン、チーズに野菜、好きな食材を贅沢に詰め込んで、お気に入りのレシピを見つけてください。<br /><br />・パニーニプレート<br />こんがりアツアツ、本格的な焼き上がりが楽しめるパニーニプレート。<br />仕切りがないから、フォカッチャやバケットなど、パンのカタチも気にせずに使えて、プレートランチやメインディッシュの付け合せにもぴったりな野菜のグリルにも活躍。<br /><br />★ 調理後のお手入れもかんたん<br />フッ素樹脂加工のプレートは汚れがつきにくく、取り外して丸洗いできるのでお手入れ簡単、衛生的。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 電源：AC100V　50/60Hz<br />* 消費電力：900W<br />* 外形寸法：約245(W)X255(D)X107(H)mm<br />* 質量：2.5kg(ワッフルプレート含む)<br />* コード長：約1.6m（有効長）<br />* 主材料：本体/フェノール樹脂、ステンレススチール<br />* プレート/フッ素樹脂加工アルミダイキャスト<br />* 原産国：中国　　保証書付</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
